from scipy import stats as st
import pandas as pd


class Distribution(object):

    def __init__(self, dist_names_list=[]):
        self.dist_names = ['alpha', 'beta', 'bradford', 'chi', 'chi2', 'dgamma', 'dweibull', 'erlang', 'exponnorm', 'exponweib',
                           'exponpow', 'gamma', 'genlogistic', 'genpareto',
                            'gennorm', 'genexpon', 'gengamma', 'halflogistic',
                            'halfnorm', 'halfgennorm', 'invgamma', 'invgauss',
                           'invweibull', 'laplace', 'loggamma', 'logistic',
                           'loglaplace', 'lognorm', 'maxwell', 'norm', 'pareto',
                           'powerlaw', 'powerlognorm', 'powernorm', 'uniform',
                           'weibull_max', 'weibull_min', 'johnsonsu', 'levy']
        self.dist_results = []
        self.params = {}

        self.DistributionName = ""
        self.PValue = 0
        self.Param = None

        self.isFitted = False

    def Fit(self, y):
        self.dist_results = []
        self.params = {}
        for dist_name in self.dist_names:
            dist = getattr(st, dist_name)
            param = dist.fit(y)

            self.params[dist_name] = param
            # applying the Kolmogorov-Smirnov test
            D, p = st.kstest(y, dist_name, args=param)
            print(dist_name, p)
            self.dist_results.append((dist_name, p))

        # select the best fitted distribution
        sel_dist, p = (max(self.dist_results, key=lambda item: item[1]))
        # store the name of the best fit and its p value
        self.DistributionName = sel_dist
        self.Param = self.params[sel_dist]
        self.PValue = p

        self.isFitted = True
        return self.DistributionName, self.PValue, self.Param


def fit_distributions_to_all_columns(data):
    fit_results = {}
    distribution_fitter = Distribution()
    for column in data.columns:
        column_data = data[column]
        dist_name, p_value, params = distribution_fitter.Fit(column_data)
        fit_results[column] = {
            'Best Fit Distribution': dist_name,
            'P Value': p_value,
            'Parameters': params
        }
    return fit_results


def BranchLenDist(file_path):
    df = pd.read_csv(file_path)
    # print(len(df))
    # emp_dist = [float(i) for i in df['branchLen'].values if i > 0.00001]
    # df = df[df.iloc[:, 0] > 0.00001]
    # print(len(df))
    # dst = Distribution()
    # name, p, para = dst.Fit(df)
    # print(name, p[0], para)

    # for multiple columns
    all_res = []
    res = fit_distributions_to_all_columns(df)
    # print(res)
    all_res.append(res)
    return


if __name__ == '__main__':
    files = ['F.csv']
    for file in files:
        BranchLenDist(file)

